  getters: {
    imgServerUrl: state => {
      return (state.config.Web_Set_DefaultInfo?.imgserver_url as INormal)?.v || ''
    },
    QBuy_Config: state => {
      return (state.config.Web_BuySell_Coin_Times.QBuy_Config as any)?.config || ''
